import React from 'react';
import { Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

const HelpSidebar = () => {
  return (
    <div>
      <Nav className="flex-column">
        <Nav.Link as={NavLink} to="#" active>Ay√∫danos</Nav.Link>
        <Nav.Link as={NavLink} to="#">Adopta o acoge</Nav.Link>
        <Nav.Link as={NavLink} to="#">Hazte socio o padrino</Nav.Link>
        <Nav.Link as={NavLink} to="#">Hazte voluntario</Nav.Link>
        <Nav.Link as={NavLink} to="#">Dona</Nav.Link>
        <Nav.Link as={NavLink} to="#">Tienda Solidaria</Nav.Link>
        <Nav.Link as={NavLink} to="#">Contacta con nosotros</Nav.Link>
      </Nav>
    </div>
  );
};

export default HelpSidebar;
